import React from 'react';
import Skills from "./Skills";
import NavigationBar from "./NavigationBar";
import Footer from "./Footer";

import './style/App.css';
import './style/SkillPage.css';

class SkillPage extends React.Component {
    render() {
        return (
          <div className="global">
              <NavigationBar/>
              <Skills/>
              <div className="align-self-center" >
                  <div className="skill-row" style={{display: 'inline'}}>
                      <p className="skill-title" style={{marginRight: '5em',float: 'left'}}>Languages:</p>
                      <p className="skill-content" style={{float: 'right'}}>
                          C, SQL, Java, Python, Shell Script,
                          Javascript, Eiffel, Assembly, Verilog, HTML5, CSS
                      </p>
                  </div>
                  <div className="skill-row" style={{display: 'inline'}}>
                      <p className="skill-title" style={{marginRight: '5.4em', float: 'left'}}>Platforms:</p>
                      <p className="skill-content" style={{}}>Linux, Windows (Desktop and Mobile), Android, iOS</p>
                  </div>
                  <div className="skill-row" style={{display: 'inline'}}>
                      <p className="skill-title" style={{marginRight: '4.2em', float: 'left'}}>Applications:</p>
                      <p className="skill-content" style={{}}>MS Office (Word, Excel, PowerPoint, Outlook)</p>
                  </div>
                  <div className="skill-row" style={{display: 'inline'}}>
                      <p className="skill-title" style={{marginRight: '0.8em', float: 'left'}}>Development Tools:</p>
                      <p className="skill-content" style={{}}>Git, Eclipse, React JS, NodeJS, Webpack, MongoDB, Redux, Express and ES6</p>
                  </div>
              </div>
              <Footer/>
          </div>
        );
    }
}

export default SkillPage;
